css:
@-moz-document url-prefix("http://sbazar.cz"),
               url-prefix("https://sbazar.cz"),
               url-prefix("http://www.sbazar.cz"),
               url-prefix("https://www.sbazar.cz"),
               regexp("https?://[a-zA-Z0-9]+\.dev(:[0-9]+)?/.*")
{

  .mrEgg .paw {
	position: absolute;
    top: 10px;
    left: inherit;
    right: 10px;
    width: 36px;
    height: 36px;
    box-shadow: 0 0 0 1px rgba(0,0,0,.2);
    border-radius: 18px;
    z-index: 10;
    
    background: url('http://seznam.tomaskafka.com/sbazar/paw.png') no-repeat center center;
  }
  
  .mrEgg .paw .paw-title {
  	display: none;
  }
}
